import React from "react";
import * as C from "./styles";

const Buttonaux = ({ Text, onClick, Type = "buttonaux" }) => {
  return (
    <C.Buttonaux type={Type} onClick={onClick}>
      {Text}
    </C.Buttonaux>
  );
};

export default Buttonaux;
